import Expenses from "./components/Expenses/Expenses";
function App() {
  const dolarToTl = 13.7;
  const expenses = [
    {
      id: "e1",
      title: "Tualet Kağıdı",
      amount: 94.12 * dolarToTl,
      date: new Date(2020, 7, 14),
    },
    {
      id: "e2",
      title: "Yeni Televizyon",
      amount: 799.49 * dolarToTl,
      date: new Date(2021, 2, 12),
    },
    {
      id: "e3",
      title: "Araba Masrafı",
      amount: 294.67 * dolarToTl,
      date: new Date(2021, 2, 28),
    },
    {
      id: "e4",
      title: "Yeni Masa (Ağaç)",
      amount: 450 * dolarToTl,
      date: new Date(2021, 5, 12),
    },
  ];
  return (
    <div>
      <h2>Hadi Başlayalım</h2>
      <Expenses expenses={expenses} />
    </div>
  );
}

export default App;
